import React, { useEffect  } from 'react';


let dog = {};
export const DisplayDog = ({getDogFromUrl}) => {

    useEffect(() => {
        getDogFromUrl().then( res => {
            dog = res;
        }

        );
    },[]);

    return(
        <div className="dog-image">
            <h3>Random Dog</h3>
            <p>
                File size = {dog.fileSizeBytes}
            </p>
            <img src={dog.url} alt="Random Dog" width="200"/>
        </div>
    );
}

export default DisplayDog
